@Fernando Pois é, Fernando , pois é, então vc coloca no mesmo saco lula e Bolsonaro, grande prova que vc ou odeia atual PR ou realmente vc é plenamente alienado em política, alguém na linha"  Anita comentarista". Mas pra vc tanto faz, acusa  atual PR de ladrão e fica por isto mesmo, pode acusar e não vai dar nada pra vc, não temos real justiça pra tratar pessoas como vc , que acusam o PR sem qualquer prova, não precisa prova, e vida que segue.Tomara que seu grau de honestidade seja tão elevado que um dia ninguém te acuse de ladrão, e aí veremos o que a nossa nobre justiça poderá fazer pra aliviar sua honra.
Pra mim já deu , lamento sua postura , discordar em política é super normal, mas sair acusando sem provas aí já é outra coisa, e não serei eu quem deveria lhe ensinar isto.
Estou desembarcando, se  quiser repensar, ótimo , se persistir a Vida te ensinará de outra forma.

